 */
create schema if not exists academia;

set schema 'academia';

create table if not exists persona(
	dni VARCHAR(10) primary key,
	nombre VARCHAR(25) not null,
	apellidos VARCHAR(60) not null,
	fecha_nacimiento DATE not null,
	email VARCHAR(50) not null,
	numero_cuenta VARCHAR(25) not null
);

create table if not exists telefono(
	id serial primary key,
	dni VARCHAR(10) not null,
	telefono VARCHAR(25) not null
);

create table if not exists direccion(
	dni VARCHAR(10) primary key,
	id_poblacion int not null,
	calle varchar(200) not null,
	numero varchar(5) not null,
	extension varchar(100) not null
);

create table if not exists poblacion(
	id serial primary key,
	id_provincia int not null,
	nombre varchar(50) not null
);

create table if not exists provincia(
	id serial primary key,
	nombre varchar(50) not null
);

create table if not exists matricula(
	id serial primary key,
	dni_alumno VARCHAR(10) not null,
	id_asignatura int not null,
	apto boolean,
	fecha_matriculacion date not null
);

create table if not exists asignatura(
	id serial primary key,
	dni_profesor VARCHAR(10) not null,
	nombre VARCHAR(50)
);

alter table asignatura alter column nombre set not null; 

create table if not exists asignatura_curso(
	id serial primary key,
	id_asignatura int not null,
	id_curso int not null
);

create table if not exists curso(
	id serial primary key,
	nombre varchar(80) not null
);


create table if not exists registro_alumno(
	id serial primary key,
	id_matricula int not null,
	nombre_curso varchar(80) not null,
	apto boolean,
	fecha_matriculacion date,
	calle varchar(200) not null,
	numero varchar(5) not null,
