/*
 * Cuando me equivoco e intento hacer una foreign key a la misma tabla no se queja, es posible hacerlo:
 * SQL Error [42703]: ERROR: column "dni" referenced in foreign key constraint does not exist
 * 
 * El error es que no existe ese atributo
 */

alter table asignatura_curso 
