*** COSAS NO UTILIZADAS EN CLASE: *** 

- ¿Que tal si queremos extraer varios ids? Se puede hacer esta búsqueda:

	select p.id, p.nombre from provincia p where p.id in (1, 2);



- ¿Y si queremos extraer las provincias que empiecen por B?

	select p.id, p.nombre from provincia p where lower(p.nombre) like 'b%';

Like nos permite buscar en una cadena de texto por similitud, es decir, podemos reemplazar cualquier caracter con _ o varios con %.
En el ejemplo convierto el nombre a minúsculas y luego le indico que tiene que empezar con b y el resto que contenga lo que sea con %.

Pero podemos hacer que contenga algo en concreto, por ejemplo:

select p.id, p.nombre from provincia p where lower(p.nombre) like '%celo%';


O solo con un caracter:

select p.id, p.nombre from provincia p where lower(p.nombre) like '_arcelona';

 */



/*
En este ejemplo concreto de tabla, sería interesante hacer que la propia base de datos no admita valores duplicados.

Eso podemos hacerlo añadiendo una CONSTRAINT de tipo UNIQUE:

alter table provincia add constraint unique_nombre unique (nombre);

Así podemos evitar que se introduzcan valores duplicados si coinciden mayúsculas y minúsculas,
pero sigue permitiendo el mismo valor si se introduce en minúsculas.

En clase vimos una solución a esto cambiando el tipo de campo de VARCHAR a CITEXT (https://www.postgresql.org/docs/16/citext.html)

Pero he visto una solución mejor. En clase hemos mencionado que existen índices (o INDEX) y que las Claves Primarias
siempre son índices. Pero nunca hemos creado uno de manera manual (https://www.postgresql.org/docs/current/sql-createindex.html)

Vamos a crear un índice para el campo nombre en la tabla provincia. El propósito de los índices es agilizar las
búsquedas en ese campo, por lo que cada vez que se agrega información nueva, la base de datos tiene que categorizar esa nueva
información.

Le vamos a decir que cree un índice, que además sea unique (por lo que podríamos omitir la constraint unique sobre ese campo,
lo aplicaría el índice) y le vamos a decir que cada vez que categorice la información, le aplique la función lower (todo el texto en minúsculas):


CREATE UNIQUE INDEX index_nombre_provincia ON provincia (lower(nombre));


Decir que esto no altera la información almacenada, es decir, si se introduce en mayúsculas permanecerá en mayúsculas. No se aplica lower en la inserción.


Pero siempre podemos recuperarla aplicando lower y initcap (la primera inicial en mayúscula):


select p.id, initcap(lower(p.nombre)) as nombre from provincia p;

*/


