	num_cuenta varchar(20) NULL
);



/*
Cargamos la información en nuestro modelo utilizando una tabla auxiliar llamada tmp_personas, resultado de importar un CSV en la base de datos:
 */
	
select tp.dni, tp.nombre, concat(apellido_1, ' ', apellido_2) apellidos, cast(tp.fecha_nacimiento as date), tp.email, tp.num_cuenta
from tmp_personas tp
group by tp.dni, tp.nombre, tp.apellido_1, tp.apellido_2, tp.fecha_nacimiento , tp.email, tp.num_cuenta;

delete from persona;

select distinct tp.dni, tp.nombre, concat(apellido_1, ' ', apellido_2) apellidos, cast(tp.fecha_nacimiento as date), tp.email, tp.num_cuenta
from tmp_personas tp;

alter table provincia add constraint unique_nombre_provincia unique (nombre);

select distinct tp.provincia from tmp_personas tp; 

alter table poblacion add constraint unique_nombre_poblacion_provincia unique (nombre, id_provincia);

select distinct tp.poblacion, p.id 
from tmp_personas tp 
inner join provincia p on tp.provincia = p.nombre;

select tp.dni, tp.asignatura from tmp_personas tp where tp.fecha_matriculacion_asignatura = '';

select distinct tp.curso from tmp_personas tp;

select distinct a.id, c.id from tmp_personas tp
inner join curso c on c.nombre = tp.curso
inner join asignatura a on a.nombre = tp.asignatura;

select distinct tp.dni, p.id, tp.calle, split_part(tp."extension", ' ', 1), split_part(tp."extension", ' ', 2)   from tmp_personas tp
inner join poblacion p on p.nombre = tp.poblacion;

select distinct tp.dni, a.id, cast(tp.fecha_matriculacion_asignatura as date) from tmp_personas tp 
inner join asignatura a on a.nombre = tp.asignatura 
where tp.fecha_matriculacion_asignatura != '';



/*
Podemos hacer agregación sobre los registros de una tabla al hacer SELECT. Para esto se utiliza GROUP BY.

Hacer agregación significa que voy a coger los valores de esos campos sin repetir, y me va a permitir hacer algo con el resto.

Podemos agrupar las poblaciones por provincia y contar cuantas poblaciones tiene cada provincia:



 */
select pr.nombre, count(po.nombre) "Número de municipios" from poblacion po inner join provincia pr on pr.id = po.id_provincia group by pr.nombre;

/*

Para aplicar filtrados sobre consultas con agregados no se utiliza WHERE, se utiliza HAVING y siempre después de GROUP BY.

Vamos a extraer las provincias que tengan 3 o más municipios (>= quiere decir, mayor o igual, así saca también las que tengan 3):
 */

select pr.nombre, count(po.nombre) "Número de municipios" from poblacion po inner join provincia pr on pr.id = po.id_provincia group by pr.nombre having count(po.nombre) >= 3 ;



