/*
*** COSAS NO UTILIZADAS EN CLASE: *** 

Hasta aquí hemos utilizado solamente uniones de tablas utilizando INNER JOIN, la cual nos une las dos tablas cuando los valores
coinciden en las dos tablas en la condición de unión (ON).

¿Pero como podríamos saber si tenemos asignaturas para las que no hay profesores? Vamos a utilizar para ello LEFT JOIN.

LEFT JOIN nos va a devolver todos los registros de la tabla de la izquierda y los registros de la tabla de la derecha que
cumplan con la condicion de unión. Si no hay coincidencias, mostrará los campos de la tabla de la derecha como nulos,
pero los registros de la tabla de la izquierda aparecerán SIEMPRE.

De paso, os voy a enseñar también a crear una tabla a partir de una consulta. 

Para este ejemplo vamos a crear una tabla solo con los nombres de las asignaturas para no alterar la tabla que ya tenemos con las asignaturas
y profesores que las imparten. Solo nombres de asignaturas:

 */

create table aux_asignatura as select distinct tp.asignatura from tmp_personas tp;

/* 
Para asegurarnos que vamos a tener asignaturas para las que no hay profesor, vamos a insertar un par de ellas:
*/


/*
Una vez tenemos esta tabla, vamos a comprobar si hay algún registro de esta tabla (los tres que acabamos de insertar)
 que no esté en nuestra tabla asignatura con LEFT JOIN;
 */

select aux.asignatura, a.dni_profesor  from aux_asignatura aux left join asignatura a on a.nombre = aux.asignatura where a.dni_profesor is null;



/*
Aparte de hacer consultas a tablas, es posible hacer consultas dentro de consultas. Es lo que se conoce como subconsultas.

Vamos a suponer que necesitamos extraer la asignatura para la que hay matriculados más alumnos.

Lo primero, agruparíamos las matrículas por id_asignatura y contaríamos los alumnos que tenemos:
*/
select m.id_asignatura, count(dni_alumno) n_alumnos from matricula m group by m.id_asignatura;

/*
Ahora, vamos a utilizar esa consulta y vamos a extraer el número máximo de alumnos que hay en alguna de esas asignaturas.

Lo que tenemos que hacer es englobar esa consulta entre paréntesis y usarla como si fuera una tabla (después de FROM), pero en
este caso es obligatorio usar un alias (un nombre corto para referenciar la tabla o consulta):
 */ 


select max(naa.n_alumnos) max_n_alumnos from (select m.id_asignatura, count(dni_alumno) n_alumnos from matricula m group by m.id_asignatura) naa;

/*
Subconsultas y Vistas:

Incluso podemos hacer cualquier join de subconsultas. Vamos a utilizar esta última, que nos da el número máximo de alumnos para una asignatura
y lo vamos a unir a la subconsulta que nos da el número de alumnos por asignatura para saber cual (o cuales) son las asignaturas que tienen el mayor
número de alumnos. Y por último voy a unir con la tabla asignatura para sacar el nombre de la asignatura
*/

select a.nombre, naa.n_alumnos from
(select m.id_asignatura, count(dni_alumno) n_alumnos from matricula m group by m.id_asignatura) naa inner join
(select max(naa.n_alumnos) max_n_alumnos from 
		(select m.id_asignatura, count(dni_alumno) n_alumnos from matricula m group by m.id_asignatura) naa
) mnaa on mnaa.max_n_alumnos = naa.n_alumnos
inner join asignatura a on a.id = naa.id_asignatura;


/*
Esta consulta es muy enrevesada, ¿no os parece? Hay un mecanismo para almacenar consultas y ponerles nombre.
Esto se conoce como Vista, (o view). La diferencia entre una vista y una tabla es que en la vista no se almacena ningún valor,
simplemente es una consulta select guardada que puedo invocar con un nombre. Voy a crear una vista para la consulta de número de alumnos por asignatura:
*/

create view n_alumnos_x_asignatura as select m.id_asignatura, count(dni_alumno) n_alumnos from matricula m group by m.id_asignatura;

/* 
Y puedo invocarla como si fuera una tabla, pero no tiene almacenado nada, es como si hiciera otra vez el mismo select:
*/

select * from n_alumnos_x_asignatura;

/*
Por último, voy a reescribir la consulta que me da la asignatura con más alumnos utilizando la vista:
*/

select a.nombre, naa.n_alumnos from n_alumnos_x_asignatura naa inner join
(select max(naa.n_alumnos) max_n_alumnos from n_alumnos_x_asignatura naa) mnaa on mnaa.max_n_alumnos = naa.n_alumnos
inner join asignatura a on a.id = naa.id_asignatura;

/*
Queda algo más sencilla, ¿no?
*/
